import styled from "styled-components/native";
import { WHITE } from "./colors";

export const PressableContainer = styled.Pressable`
  background-color: slategray;
  padding: 10px 20px;
  border-radius: 8px;
`;

export const PressableText = styled.Text`
  font-size: 14px;
  color: ${WHITE};
`;
